import React from "react"

// import "./collection-item.styles.scss"

const CollectionItem = props=>{
	return(
		<div className="collection-item">
				<h1>Title</h1>
				<div className="preview">
						{
							props.items.map(item=>(
								<div>{item.name}</div>
							))
						}
				</div>
		</div>
	)
}

export default CollectionItem
